function Pokeman(pokemon) {
  return <div>Welcome, Pokeman Fan!</div>;
}

export async function getStaticProps() {
    const res = await fetch('https://pokeapi.co/api/v2')
    const posts = await res.json()

    return {
        props: {
            posts
        }
    }
}

export default Pokeman;
